import React from 'react'
import { NavigationContainer } from '@react-navigation/native'
import AuthNavigator from './auth-navigator'

const RootNavigator: React.FC<{}> = () => {
  return (
    <NavigationContainer>
      <AuthNavigator />
    </NavigationContainer>
  )
}

export default RootNavigator
